import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import './Ticket.css'
function RenderRow({ row }) {
    //var rowvals={row}.toString().split("").map((x)=>+x);
    return (
        <div>
            {row.map((item) => {
                return (
                    <span>Item={item} </span>
                )
            })}
        </div>
    )
}
const Ticket = ({ ticket }) => {
    //console.log({row1}.toString());
    return (
        <div>
            {ticket.map((row) => {
                return (
                    <div className='ticketPaper'>

                    <Grid container justify="center" className='rowOfTicket' spacing={2}>
                        {row.map((item) => {
                            if (item != 0) {
                                return (
                                    <Grid item xs={1.33}>
                                    <Paper>{item}</Paper>
                                    </Grid>
                                )
                            }
                            else {
                                return (
                                    <Grid item xs={1.33}>
                                    <Paper>"   "</Paper>
                                    </Grid>
                                )
                            }
                        })}
                    </Grid>
                    </div>
                )
            })}
        </div>
    )
}
export default Ticket;
